function PostsShowComponent({text}) {
    return (
        <div class='bg-gray-200 w-44 h-32 p-10 flex justify-center 
                    items-center overflow-ellipsis cursor-pointer 
                    whitespace-pre-wrap hover:bg-red-300  rounded-2xl'>
            <span>{text}</span>
        </div>
    )
}

export default PostsShowComponent
